INSERT INTO entries VALUES(39,replace('和国外同事沟通啊，就是特别\n\n我发现这一点特别重要：与国外同事沟通时必须保持耐心。我们之间缺乏信任基础，而你们与我们同属一个种族、宗教、文化和语言，情况完全不同。因此，我必须保持充分的耐心。\n\n已经合并','\n',char(10)),NULL,3,'无','2025-07-29 16:35:00','2025-07-29 16:35:00','Jack 交办','轻松',2,'核心进展','中','低','','自己搞定');
INSERT INTO entries VALUES(40,replace('讲 Claude Code 时，必须边做项目边讲，否则别人会听不懂。\n\n你的系统性思维强调结构化分析，但“边做边讲”高度依赖讲师当下的认知流——这本质上是非结构化的。你如何保证当讲师状态波动或学员节奏不一致时，这套方法仍能让学习效果方差可控，而不是沦为“高手带飞”的偶然成功？\n\nxxxxx','\n',char(10)),'coding 学习',2,'无','2025-07-31 07:20:56','2025-07-31 07:20:56','Jack 交办','轻松',1,'核心进展','中','低','','自己搞定');
INSERT INTO entries VALUES(41,replace('今天跟郑红叶聊如何在销售团队里搞运动，我们总结出一个四边形模型：\n\n上边：大力宣传，包括领导宣传、视觉污染、听觉污染。  \n下边：后勤扎实，所有功能上线后必须及时跟进，无论叫改8个还是快速解决问题，不能拖两天。  \n左边：目标清晰。  \n右边：快速树立榜样。\n\n有了这个模型，销售运动从6分起步。','\n',char(10)),'FSD-CC',5,'无','2025-07-31 07:24:35','2025-07-31 07:24:35','Jack 交办','轻松',5,'核心进展','中','低','','自己搞定');
INSERT INTO entries VALUES(42,replace('today i have a sharing with teacher operaion team abotu AI coding\none leanring from today, i should bring more \n\n---\n\n今天有个体会：我以为讲解 Claude Code 很简单，不过是基础操作。  \n但对第一次学习的同学，有些内容可能像听天书。  \n\n经验：别空讲知识点和操作，必须结合案例，边做边学，在案例里顺带讲清知识与技能。','\n',char(10)),NULL,3,'无','2025-07-31 08:02:28','2025-07-31 08:02:28','Jack 交办','轻松',3,'核心进展','中','低','','自己搞定');
