PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE entries (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      content TEXT NOT NULL,
      project_tag TEXT,
      importance_tag INTEGER CHECK(importance_tag BETWEEN 1 AND 5) DEFAULT 3,
      attribute_tag TEXT DEFAULT '无',
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
    , urgency_tag TEXT DEFAULT 'Jack 交办', effort_tag TEXT DEFAULT '轻松', sort_order INTEGER DEFAULT 0, daily_report_tag TEXT DEFAULT '核心进展', energy_tag TEXT DEFAULT '中', resource_consumption_tag TEXT DEFAULT '低', department_tag TEXT DEFAULT '', resource_tag TEXT DEFAULT '自己搞定');
CREATE TABLE ai_insights (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      insight_type TEXT NOT NULL,
      title TEXT NOT NULL,
      content TEXT NOT NULL,
      data_source TEXT,
      confidence_score REAL DEFAULT 0.8,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      valid_until DATETIME,
      is_active BOOLEAN DEFAULT 1
    );
CREATE TABLE work_patterns (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      pattern_type TEXT NOT NULL,
      time_period TEXT NOT NULL,
      pattern_data TEXT NOT NULL,
      analysis_date DATETIME DEFAULT CURRENT_TIMESTAMP,
      confidence_score REAL DEFAULT 0.8
    );
CREATE TABLE knowledge_base (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      document_type TEXT NOT NULL,
      title TEXT NOT NULL,
      content TEXT NOT NULL,
      summary TEXT,
      keywords TEXT,
      priority INTEGER DEFAULT 1,
      is_active BOOLEAN DEFAULT 1,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
    );
CREATE TABLE user_behavior_events (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      event_type TEXT NOT NULL,
      event_data TEXT NOT NULL,
      context TEXT NOT NULL,
      timestamp DATETIME DEFAULT CURRENT_TIMESTAMP,
      session_id TEXT NOT NULL,
      duration_ms INTEGER
    );
CREATE TABLE behavior_patterns (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      pattern_type TEXT NOT NULL,
      pattern_name TEXT NOT NULL,
      pattern_data TEXT NOT NULL,
      discovered_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      last_seen DATETIME DEFAULT CURRENT_TIMESTAMP,
      strength REAL DEFAULT 0.5,
      is_active BOOLEAN DEFAULT 1
    );
CREATE TABLE cognitive_profiles (
      user_id TEXT PRIMARY KEY,
      profile_data TEXT NOT NULL,
      confidence_score REAL DEFAULT 0.5,
      last_updated DATETIME DEFAULT CURRENT_TIMESTAMP,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP
    );
CREATE TABLE recommendations (
      id TEXT PRIMARY KEY,
      type TEXT NOT NULL,
      title TEXT NOT NULL,
      description TEXT NOT NULL,
      content TEXT,
      confidence REAL NOT NULL,
      relevance_score REAL NOT NULL,
      timing_score REAL NOT NULL,
      reasoning TEXT NOT NULL,
      expected_value REAL DEFAULT 0.5,
      effort_required TEXT DEFAULT 'medium',
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      expires_at DATETIME,
      user_feedback TEXT,
      is_active BOOLEAN DEFAULT 1
    );
CREATE TABLE knowledge_relationships (
      id TEXT PRIMARY KEY,
      source_entry_id INTEGER NOT NULL,
      target_entry_id INTEGER NOT NULL,
      relationship_type TEXT NOT NULL,
      strength REAL NOT NULL,
      confidence REAL NOT NULL,
      discovered_by TEXT NOT NULL,
      evidence TEXT NOT NULL,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      last_validated DATETIME DEFAULT CURRENT_TIMESTAMP,
      is_active BOOLEAN DEFAULT 1,
      FOREIGN KEY (source_entry_id) REFERENCES entries (id),
      FOREIGN KEY (target_entry_id) REFERENCES entries (id)
    );
CREATE TABLE user_sessions (
      session_id TEXT PRIMARY KEY,
      start_time DATETIME DEFAULT CURRENT_TIMESTAMP,
      end_time DATETIME,
      duration_ms INTEGER,
      event_count INTEGER DEFAULT 0,
      page_views INTEGER DEFAULT 0,
      interactions INTEGER DEFAULT 0,
      focus_time_ms INTEGER DEFAULT 0,
      idle_time_ms INTEGER DEFAULT 0,
      productivity_score REAL,
      session_quality TEXT DEFAULT 'medium',
      key_achievements TEXT
    );
CREATE TABLE search_history (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      query TEXT NOT NULL,
      search_options TEXT,
      result_count INTEGER DEFAULT 0,
      search_time_ms INTEGER DEFAULT 0,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      is_favorite BOOLEAN DEFAULT 0
    );
CREATE TABLE ai_model_config (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      function_name TEXT NOT NULL UNIQUE,
      model_name TEXT NOT NULL,
      description TEXT,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
    );
CREATE TABLE conversations (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      title TEXT NOT NULL,
      model_name TEXT NOT NULL,
      system_prompt TEXT,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
    , folder_id INTEGER REFERENCES conversation_folders(id));
CREATE TABLE messages (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      conversation_id INTEGER NOT NULL,
      role TEXT CHECK(role IN ('system','user','assistant')) NOT NULL,
      content TEXT NOT NULL,
      tokens_used INTEGER,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      FOREIGN KEY (conversation_id) REFERENCES conversations(id) ON DELETE CASCADE
    );
CREATE TABLE tags (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      name TEXT NOT NULL UNIQUE,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP
    );
CREATE TABLE conversation_tags (
      conversation_id INTEGER NOT NULL,
      tag_id INTEGER NOT NULL,
      PRIMARY KEY (conversation_id, tag_id),
      FOREIGN KEY (conversation_id) REFERENCES conversations(id) ON DELETE CASCADE,
      FOREIGN KEY (tag_id) REFERENCES tags(id) ON DELETE CASCADE
    );
CREATE TABLE prompt_templates (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      name TEXT NOT NULL UNIQUE,
      content TEXT NOT NULL,
      description TEXT,
      is_favorite BOOLEAN DEFAULT 0,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
    );
CREATE TABLE conversation_folders (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      name TEXT NOT NULL,
      description TEXT,
      color VARCHAR(7) DEFAULT '#3B82F6',
      icon VARCHAR(50) DEFAULT 'folder',
      position INTEGER DEFAULT 0,
      parent_id INTEGER REFERENCES conversation_folders(id),
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
    );
CREATE TABLE todos (
      id TEXT PRIMARY KEY,
      title TEXT NOT NULL,
      content TEXT,             -- 存储完整待办对象的JSON，便于前端演化兼容
      tags TEXT,                -- JSON 数组
      priority INTEGER DEFAULT 0,
      due_date TEXT,            -- ISO8601
      source TEXT,
      version INTEGER NOT NULL DEFAULT 1,
      completed INTEGER DEFAULT 0,
      category TEXT,            -- 'today' | 'week' 等
      sort_order INTEGER DEFAULT 0,
      created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      deleted_at DATETIME       -- 软删除标记
    );
CREATE TABLE todos_events (
      event_id INTEGER PRIMARY KEY AUTOINCREMENT,
      entity_id TEXT NOT NULL,
      event_type TEXT NOT NULL CHECK (event_type IN ('create','update','soft_delete','restore')),
      title TEXT,
      content TEXT,
      tags TEXT,
      priority INTEGER,
      due_date TEXT,
      source TEXT,
      version INTEGER,
      completed INTEGER,
      category TEXT,
      created_at TEXT,
      updated_at TEXT,
      deleted_at TEXT,
      actor TEXT DEFAULT 'system',
      occurred_at DATETIME DEFAULT CURRENT_TIMESTAMP,
      FOREIGN KEY(entity_id) REFERENCES todos(id) ON DELETE NO ACTION
    );
CREATE TABLE okr_goals (
        id TEXT PRIMARY KEY,
        title TEXT NOT NULL,
        content TEXT,             -- 存储完整OKR对象的JSON
        key_results TEXT,          -- JSON 数组
        completed INTEGER DEFAULT 0,
        version INTEGER NOT NULL DEFAULT 1,
        goal_index INTEGER DEFAULT 0,
        created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
        updated_at DATETIME DEFAULT CURRENT_TIMESTAMP,
        completed_at DATETIME
      );
CREATE TABLE okr_events (
        event_id INTEGER PRIMARY KEY AUTOINCREMENT,
        entity_id TEXT NOT NULL,
        event_type TEXT NOT NULL CHECK (event_type IN ('create','update','complete')),
        title TEXT,
        content TEXT,
        key_results TEXT,
        completed INTEGER,
        version INTEGER,
        goal_index INTEGER,
        created_at TEXT,
        updated_at TEXT,
        completed_at TEXT,

        actor TEXT DEFAULT 'system',
        occurred_at DATETIME DEFAULT CURRENT_TIMESTAMP,
        FOREIGN KEY(entity_id) REFERENCES okr_goals(id) ON DELETE NO ACTION
      );
DELETE FROM sqlite_sequence;
CREATE INDEX idx_entries_created_at ON entries(created_at);
CREATE INDEX idx_entries_project ON entries(project_tag);
CREATE INDEX idx_entries_importance ON entries(importance_tag);
CREATE INDEX idx_entries_sort_order ON entries(sort_order);
CREATE INDEX idx_insights_type ON ai_insights(insight_type);
CREATE INDEX idx_insights_created_at ON ai_insights(created_at);
CREATE INDEX idx_patterns_type ON work_patterns(pattern_type);
CREATE INDEX idx_patterns_date ON work_patterns(analysis_date);
CREATE INDEX idx_knowledge_type ON knowledge_base(document_type);
CREATE INDEX idx_knowledge_active ON knowledge_base(is_active);
CREATE INDEX idx_knowledge_priority ON knowledge_base(priority);
CREATE INDEX idx_behavior_events_type ON user_behavior_events(event_type);
CREATE INDEX idx_behavior_events_timestamp ON user_behavior_events(timestamp);
CREATE INDEX idx_behavior_events_session ON user_behavior_events(session_id);
CREATE INDEX idx_behavior_patterns_type ON behavior_patterns(pattern_type);
CREATE INDEX idx_behavior_patterns_active ON behavior_patterns(is_active);
CREATE INDEX idx_recommendations_type ON recommendations(type);
CREATE INDEX idx_recommendations_created ON recommendations(created_at);
CREATE INDEX idx_recommendations_active ON recommendations(is_active);
CREATE INDEX idx_knowledge_relationships_source ON knowledge_relationships(source_entry_id);
CREATE INDEX idx_knowledge_relationships_target ON knowledge_relationships(target_entry_id);
CREATE INDEX idx_knowledge_relationships_type ON knowledge_relationships(relationship_type);
CREATE INDEX idx_user_sessions_start ON user_sessions(start_time);
CREATE INDEX idx_search_history_created_at ON search_history(created_at);
CREATE INDEX idx_search_history_query ON search_history(query);
CREATE INDEX idx_search_history_favorite ON search_history(is_favorite);
CREATE INDEX idx_messages_conversation_id ON messages(conversation_id);
CREATE INDEX idx_conversations_updated_at ON conversations(updated_at);
CREATE INDEX idx_tags_name ON tags(name);
CREATE INDEX idx_conversation_tags_tag_id ON conversation_tags(tag_id);
CREATE INDEX idx_conversations_folder_id ON conversations(folder_id);
CREATE INDEX idx_folders_parent_id ON conversation_folders(parent_id);
CREATE INDEX idx_folders_position ON conversation_folders(position);
CREATE INDEX idx_todos_active ON todos(deleted_at);
CREATE INDEX idx_todos_due ON todos(due_date);
CREATE INDEX idx_todos_priority ON todos(priority);
CREATE INDEX idx_todos_category ON todos(category);
CREATE INDEX idx_todos_sort_order ON todos(sort_order);
CREATE INDEX idx_todos_events_entity ON todos_events(entity_id, occurred_at);
CREATE TRIGGER trg_todos_after_insert
    AFTER INSERT ON todos
    BEGIN
        entity_id, event_type, title, content, tags, priority, due_date, source, version, completed, category, created_at, updated_at, deleted_at
      ) VALUES (
        NEW.id, 'create', NEW.title, NEW.content, NEW.tags, NEW.priority, NEW.due_date, NEW.source, NEW.version, NEW.completed, NEW.category, NEW.created_at, NEW.updated_at, NEW.deleted_at
      );
    END;
CREATE TRIGGER trg_todos_after_update
    AFTER UPDATE ON todos
    BEGIN
        entity_id, event_type, title, content, tags, priority, due_date, source, version, completed, category, created_at, updated_at, deleted_at
      ) VALUES (
        NEW.id,
        CASE
          WHEN OLD.deleted_at IS NULL AND NEW.deleted_at IS NOT NULL THEN 'soft_delete'
          WHEN OLD.deleted_at IS NOT NULL AND NEW.deleted_at IS NULL THEN 'restore'
          ELSE 'update'
        END,
        NEW.title, NEW.content, NEW.tags, NEW.priority, NEW.due_date, NEW.source, NEW.version, NEW.completed, NEW.category, NEW.created_at, NEW.updated_at, NEW.deleted_at
      );
    END;
CREATE INDEX idx_okr_completed ON okr_goals(completed);
CREATE INDEX idx_okr_goal_index ON okr_goals(goal_index);
CREATE INDEX idx_okr_events_entity ON okr_events(entity_id, occurred_at);
CREATE TRIGGER trg_okr_after_insert
      AFTER INSERT ON okr_goals
      BEGIN
          entity_id, event_type, title, content, key_results, completed, version, goal_index, created_at, updated_at, completed_at
        ) VALUES (
          NEW.id, 'create', NEW.title, NEW.content, NEW.key_results, NEW.completed, NEW.version, NEW.goal_index, NEW.created_at, NEW.updated_at, NEW.completed_at
        );
      END;
CREATE TRIGGER trg_okr_after_update
      AFTER UPDATE ON okr_goals
      BEGIN
          entity_id, event_type, title, content, key_results, completed, version, goal_index, created_at, updated_at, completed_at
        ) VALUES (
          NEW.id,
          CASE
            WHEN OLD.completed = 0 AND NEW.completed = 1 THEN 'complete'
            ELSE 'update'
          END,
          NEW.title, NEW.content, NEW.key_results, NEW.completed, NEW.version, NEW.goal_index, NEW.created_at, NEW.updated_at, NEW.completed_at
        );
      END;
COMMIT;
